&lt;div style=&quot;text-align: justify;&quot;&gt;CEL NAUKOWY: Celem artykułu jest przedstawienie dwóch sposobów pojmowania człowieka dominujących w zachodniej myśli politycznej: liberalnego i republikańskiego.&lt;/div&gt;
&lt;div style=&quot;text-align: justify;&quot;&gt;PROBLEM I METODY BADAWCZE: W artykule postawiono następujące pytania: Jaka jest istota podejścia republikańskiego, wywodzonego zwłaszcza z rozważań Arystotelesa? Czy „natura gatunkowa” skłania go do życia w grupach społecznych, szczególnie w doskonałej, bo samowystarczalnej wspólnocie państwowej? Czy moment polityczny dopełnia jedynie „naturalny” moment społeczności człowieka? Jaka jest istota podejścia liberalnego, które od XVII w. „konkuruje” z podejściem republikańskim? Czy człowiek zyskał inne charakterystyki, niż przydawano mu ongiś? Czy wpierw tworzy on – jak u Hobbesa – państwo jako instancję nadającą mu walor polityczny, która umożliwia mu dopiero tworzenie grup społecznych? Czy raczej – jak u Locke’a – ustanawia on zbiorowość, by ta chroniła posiadane przez niego uprawnienia przyrodzone, i nadaje jej walor polityczny?&lt;/div&gt;
&lt;div style=&quot;text-align: justify;&quot;&gt;PROCES WYWODU: Zaprezentowano istoty obu podejść oraz dokonano krytycznej analizy argumentów podnoszonych przez ich zwolenników. Oba podejścia zostały następnie odniesione do współczesnych debat dotyczących społeczeństw wielokulturowych realizujących projekt demokracji liberalnej.&lt;/div&gt;
&lt;div style=&quot;text-align: justify;&quot;&gt;WYNIKI ANALIZY NAUKOWEJ: Przedstawione w tekście wywody uka zują napięcia nie tylko między podejściami republikańskim (w pewnym zakresie bliskim także katolickiej nauce społecznej) i liberalnym, ale także między różny mi ujęciami właściwymi drugiemu z nich. Każde z tych napięć rzutuje na współczesne sposoby prezentowania rozwiązań odnoszących się do społeczeństw wielokulturowych. Oddziałują na nie również odmienne antropologie obierane przez zwolenników każdego z tych podejść i każdej z ich odmian.&lt;/div&gt;
&lt;div style=&quot;text-align: justify;&quot;&gt;WNIOSKI, INNOWACJE, REKOMENDACJE: Analizowane napięcia są wciąż aktualne we współczesnej refleksji nad człowiekiem (jednostką, pod miotem, osobą ludzką) pozostającym w relacji z innymi ludźmi (jednostkami etc.). Ujawniają się one również w rozważaniach o powinnościach ciążących na podmiocie/osobie w zestawieniu z zyskującym na znaczeniu konsekwencjalistycznym ujęciem utylitarystycznym.&lt;/div&gt;

&lt;div class=&quot;page&quot; data-page-number=&quot;2&quot; data-loaded=&quot;true&quot;&gt;
&lt;div class=&quot;textLayer&quot;&gt;
&lt;div style=&quot;text-align: justify;&quot;&gt;RESEARCH OBJECTIVE:&lt;/div&gt;
&lt;div style=&quot;text-align: justify;&quot;&gt;The aim of the article is to present two ways of understanding man dominating in Western political thought: liberal and republican.&lt;/div&gt;
&lt;div style=&quot;text-align: justify;&quot;&gt;THE RESEARCH PROBLEM AND METHODS:&lt;/div&gt;
&lt;div style=&quot;text-align: justify;&quot;&gt;The article poses the following questions: what is the essence of the republican approach, derived especially from Aristotle’s considerations? Does the “nature of the species” lead him to live in social groups, especially in a perfect, self‑sufficient state community? Does the political moment merely complete the “natural” moment of human society? What is the essence of the liberal approach, which has been “competing” with the republican approach since the seventeenth century? Has man acquired different characteristics than he was once given? Does he first create, as in Hobbes’s case, the state as an instance that gives it political value,&lt;/div&gt;
&lt;div style=&quot;text-align: justify;&quot;&gt;which only enables it to create social groups? Or, as in Locke’s case, does he establish a collectivity to protect his natural rights and give it political value?&lt;/div&gt;
&lt;div style=&quot;text-align: justify;&quot;&gt;THE PROCESS OF ARGUMENTATION:&lt;/div&gt;
&lt;div style=&quot;text-align: justify;&quot;&gt;The essence of both approaches is presented and a critical analysis of the arguments raised by their proponents is made. Both approaches were then applied to contemporary debates concerning multicultural societies pursuing the project of liberal democracy.&lt;/div&gt;
&lt;div style=&quot;text-align: justify;&quot;&gt;RESEARCH RESULTS:&lt;/div&gt;
&lt;div style=&quot;text-align: justify;&quot;&gt;The arguments presented in the text show the tensions not only between the republican approach (to some extent also close to Catholic social teaching) and the liberal one, but also between the different approaches characteristic of the latter. Each of these tensions affects contemporary ways of presenting solutions relating to multicultural societies. They are also influenced by the different anthropologies chosen by the proponents of each of these approaches and each of their variations.&lt;/div&gt;
&lt;/div&gt;
&lt;/div&gt;
&lt;div class=&quot;page&quot; data-page-number=&quot;3&quot; data-loaded=&quot;true&quot;&gt;
&lt;div class=&quot;textLayer&quot;&gt;
&lt;div style=&quot;text-align: justify;&quot;&gt;CONCLUSIONS, INNOVATIONS, AND RECOMMENDATIONS:&lt;/div&gt;
&lt;div style=&quot;text-align: justify;&quot;&gt;The analyzed tensions are still valid in the contemporary reflection on the human being (individual, subject, human person) found in relation to other people (individuals, etc.). They are also revealed in the considerations about the duties incumbent on the subject/person in comparison with the consequentialist utilitarian approach, which is gaining in importance.&lt;/div&gt;
&lt;/div&gt;
&lt;/div&gt;
